import React from 'react';

import 'antd/dist/antd.css';
import './App.css';

import { Route, Switch } from 'react-router-dom' 
import OARBeliAdd from './components/OARBeliAdd.jsx';

function App() {
  const App = () => {
    return (
    <div className="App">
      <Switch>
        <Route exact path='/OARBeli/add' component={OARBeliAdd}/>
      </Switch>
    </div>
    );
  }

  return (
    <Switch>
      <App/>
    </Switch>
  );
}


export default App;
